import React, { Component } from "react";
import "./TeamScore.scss";

class TeamScore extends Component {
  render() {
    return (
      <div class="team-score">
        <h1 style={{ marginBottom: 0 }}>{this.props.count}</h1>
        <h2 style={{ marginTop: 0, marginBottom: "56px" }}>
          {this.props.name}
        </h2>
        <h3 style={{ marginTop: 0, marginBottom: 0 }}>{this.props.earned}</h3>
        <h4 style={{ marginTop: 0, marginBottom: 0 }}>earned</h4>
      </div>
    );
  }
}

export default TeamScore;
